import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import imagen1 from './carrousel1.png'
import imagen2 from './carrousel2.png'
import imagen3 from './carrousel3.png'
import imagen4 from './carrousel4.png'
import Slider from 'react-slick';
import './carousel.css';

function Carrusel() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 2,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2
        }
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };
  return (
    <div className='carousel'>
      <Slider {...settings}>
        <div ><img className='imagenes' src={imagen1} /></div>
        <img className='imagenes' src={imagen2} />
        <img className='imagenes' src={imagen3} />
        <img className='imagenes' src={imagen4} />
        <img className='imagenes' src={imagen1} />
        <img className='imagenes' src={imagen2} />
        <img className='imagenes' src={imagen3} />
        <img className='imagenes' src={imagen4} />
      </Slider>
    </div>
  );
}
export default Carrusel;
